(function preferences_prompt(doc) {
  var $el = doc.getElementById(&quot;preferences_prompt_submit&quot;),
      $closeBtn = doc.getElementsByClassName(&quot;close_btn_thick&quot;)[0],
      $body = doc.getElementsByClassName(&quot;consent_preferences&quot;)[0],
      reg_match = /\d+$/;

  var callBack = function () {

    var inputs = $body.getElementsByClassName(&quot;toggle&quot;),
    cats = {};

    for (var i = 0; i &lt; inputs.length; i++) {
      var obj = inputs[i];
      cats[obj.id.match(reg_match)[0]] = obj.checked ? 1 : 0;
    }
    closePrompt();

    utag.gdpr.setPreferencesValues(cats);

  };
  var closePrompt = function () {
    var $privacy_prompt = doc.getElementsByClassName(&quot;consent_preferences&quot;)[0];
    $privacy_prompt.style.display = &quot;none&quot;;
  };

  var array = utag.gdpr.getConsentState();
  for (var i = 0; i &lt; array.length; i++) {
      if (array[i].ct !== &quot;1&quot;) {
          continue;
      }
      document.getElementById(&quot;toggle_cat&quot; + (i + 1)).checked = true;
  }

  if (doc.addEventListener) {
    $el.addEventListener(&quot;click&quot;, callBack, false);
    $closeBtn.addEventListener(&quot;click&quot;, closePrompt, false);
  } else if (doc.attachEvent) {
    doc.attachEvent(&quot;click&quot;, callBack);
    $closeBtn.attachEvent(&quot;click&quot;, closePrompt);
  } else {
    $el.onclick = callBack;
    $closeBtn.onclick = closePrompt;
  }
}(document));

